import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Importa también Routes y Route
import Login from './Login';
import App from './App';

// Define el componente Main fuera del bloque de la función ReactDOM.render
function Main() {
  return (
    <Routes>
      {/* Ruta para el componente Login */}
      <Route path="/" element={<Login />} />
      {/* Ruta para el componente App */}
      <Route path="/app" element={<App />} />
    </Routes>
  );
}

ReactDOM.render(
  <Router>
    <Main /> {/* Utilizamos Main como el componente raíz */}
  </Router>,
  document.getElementById('root')
);

export default Main; // Exporta el componente Main para que pueda ser utilizado en otros archivos
